import React from "react";
import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";



import './App.css';
import Header from './components/Header'
import NotesListPages from './pages/NotesListPages'
function App() {
  return render (
    <BrowserRouter>
        <Routes>
        <div className="App">

            <Header />
            <Route path="/" exact component={NotesListPages}/>
        </div>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
